INSERT INTO `people` VALUES (8967, ' https://www.imperial.ac.uk/people/lucy.thorne08', 'Home - Dr Lucy Thorne', 'lucy.thorne08@imperial.ac.uk', 'All viruses have to overcome this system to infect, and our goal is to understand how this contributes to emerging virus transmission, pandemic potential and pathogenesis. A key question for us is what makes pandemic viruses special? We focus on understanding their ability to manage and manipulate the innate immune system for effective human-human transmission. This is key to understanding which viruses pose the most risk for future pandemics. Through studying virus-host interactions, we aim to reveal novel opportunities for therapeutic intervention to limit virus replication and inflammation, and to use viruses as discovery tools to uncover new knowledge of cell biology and innate immune regulation.', 'Imperial College London', '病毒学学院', 'UK');
